import Header from "./Header";
import "./css/Page1.css"
import circle1 from "./image/1-1.png";
import circle2 from "./image/1-2.png";
import circle3 from "./image/1-3.png";

function Page1() {
    return (
        <div>
        <Header/>
        <ul className="circle-Page1">
            <li><img src={circle1} className="circle"></img></li>
            <li><img src={circle2} className="circle"></img></li>
            <li><img src={circle3} className="circle"></img></li>
        </ul>
       
        </div>
    );
}

export default Page1;
